internal.description:
- продажа, пошив европейских и национальных свадебных платьев, мужских и детских костюмов;

- оформление свадьбы (драпировка тканью, драпировка стола молодоженов, оформление шарами, украшение стульев, драпировка и декорирование столов гостей, оформление свадебной арки, оформление зала искусственными цветами);

- оформление выездной регистрации;

- свадебные аксессуары (бонбоньерки, свадебные корзины для приданого, открытки ручной работы, пригласительные, рассадочные карточки для гостей, бокалы для молодоженов, украшение бутылок на свадьбу, аксессуары для фотосессии, книга пожеланий, свадебный фотоальбом, подушки для колец, искусственные лепестки роз, декоративная клетка,);

- украшения для невесты (бижутерия, свадебный букет, букет – дублер, украшения для волос, подвязки);

- украшения для жениха (бутоньерки, галстуки, бабочки).
